import ReactDOM from 'react-dom';
import '../App.css'

const Modal = ({ isShowing, hide }) => isShowing ? ReactDOM.createPortal(
  <React.Fragment>
    <div className="modal-overlay"/>


        <p>
          Hello, I'm a modal.
        </p>



  </React.Fragment>, document.body
) : null;

export default Modal;
